import React from 'react';
import { Link } from 'react-router-dom';

const PaymentOptions = () => {
  return (
    <div className="payment-options">
      <h2>Select a Payment Option</h2>
      <div className="payment-cards">
        <div className="card visa">
          <h3>Visa</h3>
          <p>**** **** **** 1234</p>
          <Link to="/payment/visa">Pay Now</Link>
        </div>
        <div className="card mastercard">
          <h3>Mastercard</h3>
          <p>**** **** **** 5678</p>
          <Link to="/payment/mastercard">Pay Now</Link>
        </div>
        <div className="card paypal">
          <h3>PayPal</h3>
          <p>johndoe@example.com</p>
          <Link to="/payment/paypal">Pay Now</Link>
        </div>
      </div>
    </div>
  );
};

export default PaymentOptions;
